import {
    HomeOutlined,
    SettingFilled,
    SmileOutlined,
    SyncOutlined,
    LoadingOutlined,
    BulbTwoTone,
    PieChartTwoTone,
    StarTwoTone
  } from '@ant-design/icons';
import React from 'react';
import { Routes,BrowserRouter as Router,Route,Link,NavLink,Outlet  } from 'react-router-dom';


class Home extends React.Component{
    render(){
        return(

            <div>
                <BulbTwoTone fontSize="500px"/>
                <PieChartTwoTone />
                <StarTwoTone />
            </div>
            )
    }
}
export default Home;
